ALANNAH MYLES &amp; ZUCCHERO -  What Are We Waiting For  (1997) 




 &quot; What Are We Waiting For&quot; is a song written by Phil Roy ,Simon Wilson and Siobhan Maher. The song was  origina by performed by Alannah Myles and  Zucchero in 1997 .A pretty rare duett issued on the soundtrack to the little known movie &quot;Prince Valiant&quot;
